// src/router/index.js
import Vue from 'vue';
import Router from 'vue-router';
import DeviceList from '../components/DeviceList.vue';
import DeviceDetails from '../components/DeviceDetails.vue';

Vue.use(Router);

export default new Router({
  routes: [
    {
      path: '/',
      name: 'DeviceList',
      component: DeviceList
    },
    {
      path: '/device-details',
      name: 'DeviceDetails',
      component: DeviceDetails,
      props: true
    }
  ]
});
